import React, { useState, useEffect } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const UserAdmin = () => {
  const navigate = useNavigate();
  const [users, setUsers] = useState([]);
  const [role, setRole] = useState("USER");
  const [form, setForm] = useState({});
  const [message, setMessage] = useState("");

  useEffect(() => {
    fetchUsers();
  }, []);

  const fetchUsers = async () => {
    try {
      const res = await axios.get("http://localhost:8080/admin/users");
      setUsers(res.data);
    } catch (err) {
      setMessage("❌ Failed to load users.");
    }
  };

  const handleInputChange = (e) => {
    setForm((prev) => ({
      ...prev,
      [e.target.name]: e.target.value,
    }));
  };

  const handleCreate = async () => {
    try {
      if (role === "ADMIN") {
        await axios.post("http://localhost:8080/admin", {
          username: form.username,
          password: form.password,
          email: form.email,
          role: { name: "ADMIN" },
        });
      } else {
        await axios.post("http://localhost:8080/api/users", {
          username: form.username,
          password: form.password,
          email: form.email,
          firstName: form.firstName,
          lastName: form.lastName,
          dateOfBirth: form.dateOfBirth,
          role: { name: "USER" },
          address: {
            street: form.street,
            zipCode: form.zipCode,
            placeName: form.placeName,
            stateName: form.stateName,
          },
        });
      }

      setMessage("✅ User created successfully!");
      setForm({});
      fetchUsers();
    } catch (err) {
      setMessage("❌ Failed to create user.");
    }
  };

  const handleDelete = async (username) => {
    try {
      await axios.delete(`http://localhost:8080/api/users/${username}`);
      setMessage(`✅ User "${username}" removed.`);
      fetchUsers();
    } catch (err) {
      setMessage("❌ Failed to remove user.");
    }
  };

  return (
    <div className="p-6 min-h-screen bg-gray-50">
      <button
        className="mb-6 px-4 py-2 bg-blue-500 text-white rounded"
        onClick={() => navigate("/admin")}
      >
        🔙 Back to Admin Dashboard
      </button>

      <h1 className="text-3xl font-bold mb-4">👤 User Administration</h1>

      {message && <p className="text-blue-700 mb-4">{message}</p>}

      {/* Role switcher */}
      <div className="flex space-x-4 mb-4">
        <button
          onClick={() => setRole("ADMIN")}
          className={`px-4 py-2 rounded ${role === "ADMIN" ? "bg-indigo-500 text-white" : "bg-gray-200"}`}
        >
          Create ADMIN
        </button>
        <button
          onClick={() => setRole("USER")}
          className={`px-4 py-2 rounded ${role === "USER" ? "bg-indigo-500 text-white" : "bg-gray-200"}`}
        >
          Create USER
        </button>
      </div>

      {/* Form */}
      <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mb-6">
        <input name="username" placeholder="Username" value={form.username || ""} onChange={handleInputChange} className="p-2 border rounded" />
        <input name="password" type="password" placeholder="Password" value={form.password || ""} onChange={handleInputChange} className="p-2 border rounded" />
        <input name="email" placeholder="Email" value={form.email || ""} onChange={handleInputChange} className="p-2 border rounded" />
        {role === "USER" && (
          <>
            <input name="firstName" placeholder="First Name" value={form.firstName || ""} onChange={handleInputChange} className="p-2 border rounded" />
            <input name="lastName" placeholder="Last Name" value={form.lastName || ""} onChange={handleInputChange} className="p-2 border rounded" />
            <input name="dateOfBirth" type="date" value={form.dateOfBirth || ""} onChange={handleInputChange} className="p-2 border rounded" />
            <input name="street" placeholder="Street" value={form.street || ""} onChange={handleInputChange} className="p-2 border rounded" />
            <input name="zipCode" placeholder="Zip Code" value={form.zipCode || ""} onChange={handleInputChange} className="p-2 border rounded" />
            <input name="placeName" placeholder="Place Name" value={form.placeName || ""} onChange={handleInputChange} className="p-2 border rounded" />
            <input name="stateName" placeholder="State" value={form.stateName || ""} onChange={handleInputChange} className="p-2 border rounded" />
          </>
        )}
      </div>

      <button onClick={handleCreate} className="bg-green-600 hover:bg-green-700 text-white px-6 py-2 rounded mb-8">
        ➕ Create {role}
      </button>

      {/* Users list */}
      <h2 className="text-xl font-bold mb-2">📋 All Users</h2>
      <div className="space-y-2">
        {users.map((user) => (
          <div key={user.userId} className="bg-white p-4 shadow rounded flex justify-between items-center">
            <div>
              <p className="font-semibold">{user.username} ({user.role.name})</p>
              <p className="text-sm text-gray-600">{user.email}</p>
            </div>
            <button onClick={() => handleDelete(user.username)} className="bg-red-500 hover:bg-red-600 text-white px-4 py-1 rounded">
              Remove
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default UserAdmin;
